export interface PanaTokenProps extends SvgIconProps {
  name: TokenNames;
  viewBox?: string;
  fontSize?: SvgIconProps["fontSize"];
}

//declare const Token: FC<PanaTokenProps>;
export type TokenNames = keyof typeof tokenPaths;

export interface PanaTokenStackProps extends SvgIconProps {
  tokens?: PanaTokenProps["name"][];
  style?: SvgIconProps["style"];
  images?: string[];
}

export const Token: FC<PanaTokenProps> = ({ name, viewBox = "0 0 24 24", fontSize = "large", ...props }) => {
  return (
    <SvgIcon viewBox={viewBox} fontSize={fontSize} {...props}>
      {tokenPaths[name]}
    </SvgIcon>
  );
};

const TokenStack: FC<PanaTokenStackProps> = ({ tokens, style, images, ...props }) => {
  return (
    <Box display="flex" flexDirection="row">
      {tokens?.map((e, t) => {
        return <Token key={t} name={e} style={t > 0 ? { marginLeft: -6, zIndex: 1 } : { zIndex: 1 }} />;
      })}
    </Box>
  );
};

export default TokenStack;
